<!DOCTYPE html>
<html>
    <head>
        <title>list tags</title>
    </head>
<body>
    <!--listtags-->
    <ol type="I">
        <!--IN TYPE WE can use I,i,A,a-->
        <li>java fullstack</li>
        <li>python fullstack</li>
        <li>mern fullstack</li>
    </ol>
    <ul type="circle">
        <!--ul supported values are
        square,circle,bullet,none-->
        <li>biryani</li>
        <li>egg</li>
        <li>noodles</li>
    </ul>
</body>
</html>
